import React from "react";
import "./card.css"

function Card(props) {
    return (
        <div className="card-container">
            <img src={`https://robohash.org/${props.monster.id}/?set=set2&size="180"`}/>
            <h1>{props.monster.name}</h1>
        </div>
    )
}

export default Card;
